          I read this on /. maybe a week ago, but I've since been hung up on it, as I have a tendency to get stuck on thoughts:<br /><br /><blockquote>From an outsider's point of view, everything man-made is as <i>natural</i> as anything else made by other organisms on this planet.</blockquote><br /><br />Granted, it would have to be an extremely outsider point of view, but it applies. All other organisms on this planet try to survive and maintain a dominance in their niche without regard for the well-being of others. Are they entitled to something we are not because our species has come out on top? Why can we not (continue to) expend the resources available to us and move on to another habitat? Who is to define what OUR niche is? Perhaps our niche is to propagate through our solar system and then through space to spread the seeds of Earth life? Maybe instead of being on top of the food chain we are at the bottom of something of such a much larger scope that we are unaware of it?<br /><br />Just a few of the questions prompted by this intriguing statement. Comments welcome<br />
